function tableSet(table, pua) {
    $(table + " .tr").remove();
    pua.forEach(function(line) {
        var tr = '',
            colspan = 1;
        if (Object.keys(line).length == 1) colspan = 6;
        Object.keys(line).forEach(function(key) {
            var classname = '';

            tr += "<td colspan='" + colspan + "' class='" + classname + "'>" + line[key] + "</td>";
        });
        $(table).append("<tr class='tr'>" + tr + "</tr>");
    });
}
